function setAccSize(){
	var bodyPad = parseInt($('body').css("padding-top").replace("px", ""));
	var footerHeight = $("#footer").height();
	var totalHeight = bodyPad + footerHeight;
	var windowHeight = $(window).height();
	$(".account-wrapper").height(windowHeight - totalHeight);
}

/*---------- CUSTOM CODE ----------*/
$(document).ready(function() {

	$('.clouds').pan({fps: 30, speed: 2, dir: 'left'});

	
	/*--- POPUPS ---*/
	$(".login, .signup, .reset").click(function() {
		$(".popup-wrapper").removeClass("popup-show");
		$(".popup-wrapper .input").val("");
		$(".popup-wrapper label").removeClass("float");
		var popID = $(this).attr("href");
    $(popID).addClass("popup-show");
		return false;
  });
	
	$(".popup-close").click(function() {
    $(".popup-wrapper").removeClass("popup-show");
	  $(".popup-wrapper .input").val("");
		$(".popup-wrapper label").removeClass("float");
		return false;
  });
	
	/*--- ACCOUNT FORM ---*/
	if($(window).height() > 800){		
		setAccSize();
	}
	else{
		$(".account-wrapper").css("height", "auto");
	}
	
	$(".acc-login, .acc-signup, .acc-reset").click(function() {
		$(".account-details").hide();
		$(".account-details .input").val("");
		$(".account-details label").removeClass("float");
		var formID = $(this).attr("href");
    $(formID).show();
		return false;
  });
	
	$(".mobile-nav-content .login, .mobile-nav-content .signup").bind('touchstart click', function(){
		if($("body").hasClass("menu-open")){
			$("body").removeClass("menu-open");
		}
	});
	
	if( $('.floating-labels').length > 0 ) { 
		floatLabels();
	}
	
	function floatLabels() {
		var inputFields = $('.floating-labels .input');
		inputFields.each(function(){
			var singleInput = $(this);
			//check if user is filling one of the form fields 
			checkVal(singleInput);
			singleInput.on('change keyup', function(){
				checkVal(singleInput);	
			});
		});
	}

	function checkVal(inputField) {
		( inputField.val() == '' ) ? inputField.closest("li").find('label').removeClass('float') : inputField.closest("li").find('label').addClass('float');
	}
	
	/*--- MOBILE MENU ---*/	
	$('.btn-menu').bind('touchstart click', function(){
		$("body").addClass("menu-open");
		return false;
	});
	
	$("#content_mask, .menu-close").bind('touchstart click', function(){
		$("body").removeClass("menu-open");
		return false;
	});
	
	/*--- HOME ---*/
	if($("body").hasClass("home")){
		if($(window).width() > 1100){
			$('#fullpage').fullpage({
				anchors: ['home', 'how-to', 'services'],
				navigation: true,
				navigationPosition: 'right',
				navigationTooltips: ['01', '02', '03'],
				'afterLoad': function(anchorLink, index){
					if(index == 1){
						$('#lockup').removeClass('reposition');
					}
					if(index == 2){
						$('.footer-skyline-home').addClass('hide');
					}
					if(index == 3){
						$('.footer-skyline-home, .footer-hills-home, .home-sun').addClass('hide');
					}
				},
				'onLeave': function(index, nextIndex, direction){
					$('.footer-skyline-home').toggleClass('hide', (index == 1 && direction == 'down' ) || (index == 2 && direction == 'down') || (index == 3 && direction == 'up'));
					$('.footer-hills-home, .home-sun').toggleClass('hide', (index == 2 && direction == 'down' ));
					$('#lockup').toggleClass('reposition', (index == 1 && direction == 'down' ) || (index == 2 && direction == 'down') || (index == 3 && direction == 'up'));
				}
			});
		}
		
		$(".mobile-nav-content a").bind('touchstart click', function(){
			if($(this).attr("href").indexOf("#") > -1){
				var target = $(this).attr("href").split("#")[1];
				if($("body").hasClass("menu-open")){
					$("body").removeClass("menu-open");
					if($(window).width() < 1100){
						if(target != "") {
							$('html,body').animate({
								scrollTop: $('.' + target).offset().top - 60
							}, 1000);
						}
					}
				}
			}
		});
	}
	
	/*--- PRODUCTS SLIDER ---*/
	$(".owl-carousel").owlCarousel({
		margin:20,
		items:4,
		nav:true,
		navText:["<i class='flaticon-prev'></i>","<i class='flaticon-next'></i>"],
		dots:false,
		mouseDrag:false,
		responsive:{
        0:{
            items:1
        },
        600:{
            items:2
        },
        1120:{
            items:4
        }
    }	
	});
	
	/* Check initial state of Checkbox */	
	$('.products-wrapper input[type="checkbox"]').each(function() {
			if ($(this).is(":checked")) {
				$(this).parent().find("i").show();
			}
			else {
				$(this).parent().find("i").hide();
			}
	});
	
	$(".products-wrapper .product a").bind('touchstart click', function(){
		var checkBox = $(this).find(".chk");
		var icon = $(this).find("i");
    checkBox.prop("checked", !checkBox.prop("checked"));
		if(checkBox.is(":checked")){
			icon.show();
		}
		else {
			icon.hide();
		}
		return false;
	});
});

$(window).on('resize orientationchange', function(e) {
	if($(window).height() > 800){		
		setAccSize();
	}
	else{
		$(".account-wrapper").css("height", "auto");
	}
});

$(document).keydown(function(e) {
	// ESCAPE key pressed
	if (e.keyCode == 27) {
		if($("body").hasClass("menu-open")){
			$("body").removeClass("menu-open");
		}
		
		$(".popup-wrapper").removeClass("popup-show");
		$(".popup-wrapper .input").val("");
		$(".popup-wrapper label").removeClass("float");
	}
});

$(window).load(function() {
	$(".preloader").fadeOut("slow");
	setTimeout(function(){
		if(!$("body").hasClass("home")){ 
			$("#lockup").addClass("slideDown");
		}
		$(".landing-sun").addClass("bigEntrance");
	}, 1200);
	
	setTimeout(function(){
		$(".home-sun").addClass("bigEntranceHome");
		$(".home #lockup").addClass("fadeIn");
		$(".home-wrapper").addClass("fadeInUp");
	},250);
	
});

$(document).mouseup(function (e){
	var container = $(".popup-wrapper");
	if (!container.is(e.target) && container.has(e.target).length === 0) 
	{	
		$(".popup-wrapper").removeClass("popup-show");
		$(".popup-wrapper .input").val("");
		$(".popup-wrapper label").removeClass("float");
	}
});


